<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 - induced IPP / ApppI production in vivo . Bisphosphonates are currently the most important class of anti-resorptive drugs used for the treatment of diseases involving excess bone resorption . Recently we discovered a new mechanism of action for bisphosphonates . Previously it has been shown that nitrogen-containing bisphosphonates ( N-BPs ) are not metabolized . However , our studies revealed that N-BPs induce formation of a novel pro-apoptotic DB00171 analog ( ApppI ) , as a consequence of the inhibition of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 in the mevalonate pathway , and the subsequent accumulation of isopentenyl pyrophosphate ( IPP ) in vitro . The primary aim of the current study was to determine whether zoledronic acid ( a N-BP ) induces IPP / ApppI formation in vivo . Mass spectrometry was used to identify whether in vivo administration of zoledronic acid-induced IPP / ApppI production by mouse peritoneal macrophages or bone marrow cells . IPP / ApppI could be detected in extracts from peritoneal macrophages isolated from zoledronic acid-treated animals . Increasing IPP / ApppI accumulation was determined up to 7 days after drug injection , indicating prolonged 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 inhibition by zoledronic acid . Importantly , this is the first report of in vivo production of ApppI , supporting the biological significance of this molecule .</div>

 ( + ) T-cell expression of IFN- ( P &lt; 0.01 ) to levels similar to those induced by conventional immunosuppressives .

 and lovastatin also decreased IFN- expression , although to a lesser degree ( P &lt; 0.05 ) . All three statins reduced levels of

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The design and development of pegfilgrastim ( PEG-rmetHuG - 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , Neulasta ) . Recombinant protein technology produces drugs for human therapy in unprecedented quantity and quality . Research is now focusing on the relationship between pharmacokinetic and pharmacodynamic properties of molecules , with the aim of engineering proteins that possess enhanced therapeutic characteristics in contrast to being used as simple replacements for the natural equivalent . The addition of a polyethylene glycol ( PEG ) moiety to filgrastim ( rmetHu - DB00099 , Neupogen ) resulted in the development of pegfilgrastim . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00019
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is a long-acting form of filgrastim that requires only once-per-cycle administration for the management of chemotherapy-induced neutropenia . The covalent attachment of PEG to the N-terminal amine group of the parent molecule was attained using site-directed reductive alkylation . Pegylation increases the size of filgrastim so that it becomes too large for renal clearance . Consequently , neutrophil-mediated clearance predominates in elimination of the drug . This extends the median serum half-life of pegfilgrastim to 42 hours , compared with between 3.5 and 3.8 hours for DB00099 , though in fact the half-life is variable , depending on the absolute neutrophil count , which in turn reflects of the ability of pegfilgrastim to sustain production of those same cells . The clearance of the molecule is thus dominated by a self-regulating mechanism . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00019
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 retains the same biological activity as filgrastim , and binds to the same 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q99062
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , stimulating the proliferation , differentiation and activation of neutrophils . Once-per-chemotherapy cycle administration of pegfilgrastim reduces the duration of severe neutropenia as effectively as daily treatment with filgrastim . In clinical trials , patients receiving pegfilgrastim also had a lower observed incidence of febrile neutropenia than patients receiving filgrastim .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">The role of atorvastatin in regulating the immune response leading to vascular damage in a model of Kawasaki disease . Superantigens have been implicated in a number of diseases including Kawasaki disease ( KD ) , a multi-system vasculitis resulting in coronary artery aneurysms . We have characterized a murine disease model in which coronary arteritis is induced by a novel superantigen found in Lactobacillus casei cell wall extract ( LCWE ) . Using this animal model of KD , we have identified three pathogenic steps leading to coronary artery aneurysm formation . These steps include T cell activation and proliferation , production of the proinflammatory cytokine tumour necrosis factor ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375

</mark>
 ) -  and up-regulation of matrix metalloproteinase 9 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P14780
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , an elastolytic protease . In addition to their cholesterol-lowering effects , 3 - hydroxy - 3 - methylglutaryl ( HMG ) coenzyme A ( DB01992 ) reductase inhibitors ( statins ) have pleotropic immunomodulatory properties . Thus , we examined the effect of atorvastatin in modulating each of these three critical pathogenic processes leading to aneurysm formation in the disease model . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 inhibited lymphocyte proliferation in response to superantigen stimulation in a dose-dependent manner . This inhibition was also observed for production of soluble mediators of inflammation including interleukin ( IL ) - 2 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 . Similarly , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 - -induced 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 production was reduced in a dose-dependent manner in response to atorvastatin . Inhibition of extracellular-regulated kinase (

 ) phosphorylation appears to be the mechanism responsible for inhibition of
